import React from 'react';


const Person=(props)=>{
    return(
        <div>
            <h1>{props.name}</h1>
            <p>{props.email}</p>
            <span>
                <p>{props.address1}/n {props.address2}\n</p>
            </span>
        </div>
    )
}

export default Person
